import OscarData from './data.csv';
import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState(null);

  useEffect(() => {
    Papa.parse(OscarData, {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: ((result) => {
        console.log(result);
        const labelCounts = {}; // Object to store label counts

        result.data.forEach((item) => {
          const label = item['label'];

          if (label !== null && labelCounts[label] !== undefined) {
            labelCounts[label] += 1;
          }
        });

        setChartData({
          labels: ["0", "1"],
          datasets: [
            {
              label: "Count",
              data: [labelCounts["0"], labelCounts["1"]],
              borderColor: ["black", "black"],
              backgroundColor: ["red", "blue"]
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of 0 and 1 Values in the 'label' Column"
            }
          },
          scales: {
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count"
              }
            }
          },
          onClick: (event, activeElements) => {
            if (activeElements.length > 0) {
              const labelIndex = activeElements[0].index;
              const clickedLabel = chartData.labels[labelIndex];
              const clickedLabelCount = chartData.datasets[0].data[labelIndex];

              setLabelCountData({
                label: clickedLabel,
                count: clickedLabelCount
              });
            }
          }
        });
      })
    });
  }, []);

  return (
    <div>
      <h1>HOME PAGE</h1>
      {chartData.datasets.length > 0 ? (
        <div>
          <Bar options={chartOptions} data={chartData} />
        </div>
      ) : (
        <div>Loading...</div>
      )}
      {labelCountData && (
        <div>
          <h2>Label: {labelCountData.label}</h2>
          <h2>Count: {labelCountData.count}</h2>
        </div>
      )}
    </div>
  );
}

export default Home;
